			// 		H(i)0 = a + H(i-1)0
			// 		H(i)1 = b + H(i-1)1
			// 		H(i)2 = c + H(i-1)2
			// 		H(i)3 = d + H(i-1)3
			// 		H(i)4 = e + H(i-1)4
			// 		H(i)5 = f + H(i-1)5
			// 		H(i)6 = g + H(i-1)6
